import React from 'react';
import CardFront from './CardFront';
import CardBack from './CardBack';

function Card() {
  return (
    <div className='card-container'>
      <div className='card-body'>
        <CardBack />
        <CardFront />
      </div>
    </div>
  );
}

export default Card;
